    const [books,setbooks] = useState([])

    useEffect(()=>{
        const fetchAllBooks = async()=>{
            try{
                const res =await axios.get("http://localhost:8800/books")
                setBooks(res, data);
            } catch(err){
                console.log(err)
            }
        }
        fetchAllBooks()
    })
  return (
    <div>Books</div>
  )
}

